import { EmptyState, Layout, Page } from '@shopify/polaris';

const Index = () => (
    <Page>
        <Layout>
            <TextStyle variation="positive">
                Sample app using React and Next.js
        </TextStyle>
        </Layout>
    </Page>
);

export default Index;
